INSERT INTO `amc_denuncias` VALUES (1,4,1,'2017-07-22 13:23:00',1,'Denuncia web - 37','Diego Salazar Corrale',NULL,'0504230780','diegodzart75@gmail.com','Las excretas de los perros salen hasta la acera y el olor es insoportable en un día de sol pude llegar a oler hasta la otra esquina lo cual ha producido que haya cantidad de moscas la limpieza lo hace calculando una vez cada 25 días.','2','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/37-Diego\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-07-24 20:46:49',NULL),(2,4,2,'2017-07-22 20:12:00',1,'Denuncia web - 38','Nesto Vasconez Noguer',NULL,'1400526347','danilo.vasconez@gmail.com','En reiteradas ocasiones la vivienda colindante realiza fiestas con altos niveles de ruido. Personalmente he solicitado que reduzcan el ruido pero no he tenido respuestas favorables. Este ruido se da a todas horas porque aparentemente es una banda que se reúne a tocar de manera seguida. No tengo datos del dueño del predio pero si me contactan les puedo proporcionar la dirección del lugar que ocasiona el ruido. Por favor en caso de que uds no me puedan ayudar, me podrían dirigir a la entidad competente. Saludos cordiales','2','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/38-Nesto\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-07-24 21:27:35',NULL),(3,4,3,'2017-07-24 14:14:00',1,'Denuncia web - 44','Danie Orna Salvador',NULL,'1722378369','daniel.ornasalvador@hotmail.com','El día 23 de Julio del 2017 en la ciudad de Quito, en el Edificio San Siro ubicado en el pasaje Julio Moreno y Av 6 de Diciembre junto al Megamaxi, sufrí la mordedura de uno de los tres perros que viven en el dpto de mis vecinas, acudí al hospital y me revisaron la mordedura, han sido algunas veces que los animales me atacan sin razón alguna, y no solo a mí, a mi esposa, al conserje y un guardia del edificio. En vista de los ataques decidí abandonar el departamento, y para dar por terminado el contrato, la dueña del departamento que arriendo me pidió fotos de los perros, lo hice y se las envié, luego de esto una de las señoritas vecinas amenazó a mi esposa con demandarla por tomar la foto.<br />\nEl domingo 23 de julio por causa de la mordedura me vi obligado a llamar a la policía para poder ver las vacunas de los perros y estar seguro que no tenga rabia, las señoritas tomaron una actitud muy agresiva y desafiante, sin pedir disculpas y dar por terminado el problema. En conclusión me veo obligado a denunciar para que se tomen cartas al respecto, ya que tengo una hija de dos años que también corre peligro con los animales.<br />\n<br />\nGracias.','2','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/44-Danie\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-07-24 21:37:38',NULL),(4,4,4,'2017-07-24 21:03:00',1,'Denuncia web - 48','Anton Escorza leon ',NULL,'0201618212','anto.escorza@gmail.com','En el interior del domicilio se encuentra una perra de raza husky aproximadamente 2 años de edad, la cual vive en un espacio limitado para su tamaño y está privada de comida y agua.<br />\nEl patio se encuentra lleno de heces del animal y nunca recibe ningún tipo de atención . El animal no tiene protección contra lluvia o sol, además de estar caquexico ','2','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/48-Anton\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-07-25 23:19:28',NULL),(5,4,5,'2017-07-25 12:25:00',1,'Denuncia web - 55','Alex  Lowndes Arroba',NULL,'1714216403','lowndesalex@gmail.com','validar que el edificio que se esta construyendo a mi hogar cumpla con todos los requisitos y permisos de construcción necesarios.','2','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/55-Alex \' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-07-25 23:27:05',NULL),(6,4,6,'2017-07-28 13:44:00',1,'Denuncia web - 65','Helen Mosquera',NULL,'1713790804','nenam2006@hotmail.com','El perrito pasa siempre afuera, nunca le vemos con comida o agua, según los vecinos los dueños no lo hacen entrar a la casa porque el perrito no quiere, le dejan afuera en lluvia o sol, dejan que los perros callejeros lo peguen y parece que ya es adulto, hoy pase por ahí y tenía sangre en sus partes intimas y sinceramente no creo que lo lleven a un veterinario, por que no le hacen caso para nada, el suele moverles la colita pero parece que no existiera para sus dueños, se les ha preguntado el porque no lo hacen entrar pero solo responden que el perro no quiere como verán la casa tiene patio delantero y terraza, por favor una mano para rescatar a este perrito adulto, la casa está en la esquina sur de la nueva Plaza Michelena en plena Osorio y Tipantuña, una cuadra más abajo de la Avenida Mariscal Sucre al frente se encuentra la Hostal u Hotel Judy<br />\nel perrito a veces se da una vuelta por la cuadra de abajo de su casa pero siempre regresa.','2','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/65-Helen\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-07-31 14:43:21',NULL),(7,4,7,'2017-07-28 11:14:00',1,'Denuncia web - 64','Camil Rodríguez e',NULL,'1721524401','camirodrigueze90@gmail.com','El perrito permanece encadenado todo el día, todos los días. Se encuentra en mal estado y sucio. Sus condiciones de vida son deplorables y no han cambiado a lo largo de casi un año. Suele tener agua más no se registra cuando le dan de comer. Los dueños del local presentan mala disposición al hablar del asunto y aseguran que el perro se encuentra en buen estado. ','2','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/64-Camil\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-07-31 14:49:25',NULL),(8,4,8,'2017-07-28 09:11:00',1,'Denuncia web - 62','Franc Padilla Torres',NULL,'1721544144','neopaco666@gmail.com','Han hecho de la casa de alado un taller de carpintería, esto además de producir contaminación acústica produce contaminación en el aire, antes solían pintar con solventes perjudiciales para la salud (lacas, thinner, etc) ahora solo están lijando, pero el polvo que producen es irritante para las vías respiratorias. Llvan una actividad regular desde las 8:00 hasta las 17:00. <br />\nYa se ha realizado algunas denuncias en la secretaría del ambiente (caso2017-109260) ','2','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/62-Franc\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-07-31 14:51:44',NULL),(10,30,11292,'2017-08-03 10:43:58',2,'S/N','GORETTE ALTAGRACIA CARRERA ESTEVEZ',NULL,'','','CAMBIO DE DOMICILIO','1','-',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-01 13:33:14','79'),(11,30,11293,'2017-08-01 09:54:53',2,'GDOC 2017-110742','ZONA CALDERON MIRIAN AGUIRRE',NULL,'','','CONTROL PROGRAMADO','3','-',1,0,'PREDIO N°643021','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-01 14:58:29','57'),(12,30,11294,'2017-08-01 10:01:31',2,'GDOC-2017-110759','ZONA CALDERON - MIRIAN ENRIQUEA',NULL,'','','CONTROL PROGRAMADO','3','-',1,0,'PREDIO N°643021','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-01 15:01:53','57'),(13,30,11295,'2017-08-01 10:04:36',2,'S/NGDOC 2017-110648','ZONA CALDRON - MIRIAN ENRIQUEZ',NULL,'','','CONTROL PROGRAMADO','3','-',1,0,'PREDIO N°643021 ETAPA N°2','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-01 15:04:45','57'),(14,5,11296,'2