5,'5 FOJAS + 1 CARPETA','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 15:36:21','77'),(225,4,11507,'2017-08-03 08:47:00',1,'Denuncia web - 81','Maria Allauca Simalui',NULL,'1705802104','matilde_a1@hotmail.com','En este lugar tienen muchos perros sin esterilizar, sin correa, con mala alimentación y en manada, siempre me han comentado que como están sueltos salen y matan a cualquier perrito o gatito que pase por ahí o se meten al colegio, yo vivo junto al Colegio Amazonas el cual este medio de este lugar que le comento y mi casa.<br />\r\nEl día de hoy dos de mis gatitas se salieron y fueron al colegio Amazonas ellas no hacen mal a nadie estaban esterilizadas y vacunadas algo que los dueños de estos animales no han hecho y cuatro de sus perros que no se exactamente cuantos son pero son muchos las mataron yo lo vi pero no pude hacer nada para salvarlas.<br />\r\nSolicito que se haga algo, ahora me doy cuenta que lo que comentaban de que matan animalitos es cierto porque me paso a mi y no quiero que le pase a nadie mas sobre todo por culpa de persona irresponsables y que no tienen conciencia y tienen así a los perros.','2','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/81-Maria\' target=\'_blank\'>Link denuncia</a>',1,0,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 15:43:26','84'),(226,7,11508,'2017-08-03 10:50:13',2,'S/N','BOLIVAR TELLO ASTUDILLO',NULL,NULL,NULL,'INVESTIGACION ACADEMICA','12','-',1,1,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 15:50:26','77'),(227,31,11509,'2017-08-03 10:52:21',2,'OFC-2017-3837','XAVIER MOLINA - ADM. ELOY ALFARO',NULL,NULL,NULL,'INFORME DE EXP-ADM- ICUS','2','-FORMULARIO LUAE',1,2,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 15:53:12','84'),(228,31,11510,'2017-08-03 10:55:09',2,'OFC-2017-3836','XAVIER MOLINA - ADM. ZONA ELOY ALFARO',NULL,NULL,NULL,'INFORME DE EXP. ADM. LUAE','2','GDOC-2017-110725',1