ONTROL AMBIENTAL \" colinda con la parte posterior de mi domicilio donde estan ubicados en la parteposterior MOTORES  que emanan permanentemente unruido INSOPORTABLE  , que ya afectadodo la salud de mis familiares que habitamos ahi especialmente de mi señora madre quien permanece todo el dia en la casa y el sonido es ensordecedor , bibrador llegando a osacionar permanentemente dolor de cabeza y dolor de odio , como puede ser posible que siendo un laboratorio que controla el medio ambiente nos contamiente de esta manera con el ruiedo que eman los motores , mi pregunta con que calidad moral podran llamarse laboratorio del ambiente , este es un problema de mucho tiempo atras  que por versiones de vecinos no han dado solución  . Les solicito de la manera mas comedida no mostrarse indiferentes a este situación que afecta la salud  , sera qe el dueño tiene sus palancas y no han podido resolver este problema , les invito a que por favor sin previo aviso al laboratorio visiten mi domicilio y se den cuenta de la magnitud del problema, ya que su propietario en una persona que no entiende razones y no ha hecho caso omiso de mis pedidos , que incluso lo echo al personal de dicho laboratorio ,<br />\r\nEn espera de una pronta y definitiva respuesta a  esta situción anticipo mi agradecimiento ','2','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/70-GLORI\' target=\'_blank\'>Link denuncia</a>',1,0,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 16:31:24','84'),(236,31,11518,'2017-08-03 11:34:04',2,'S/N','CRUZ ELENA DIAZ QUINTEROS',NULL,NULL,NULL,'REF. EXP-2017-120','13','PRUEBAS DE DESCARGO',1,13,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 16:34:04','89'),(237,31,11519,'2017-08-03 11:38:23',2,'MEMO-2017-340','JAIME MURIEL - ELOY ALFARO',NULL,NULL,NULL,'REGISTRO DIARIO','7','REGISTRO DE ASISTENCIA',1,2,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 16:38:15','83'),(238,4,11520,'2017-08-02 11:38:00',1,'Denuncia web - 78','FRANC ANDRADE NAVARRE',NULL,'1717768947','franciss.a92@gmail.com','En el patio trasero de una lavandería (dry cleanned- Lavandería Américana), ubicada en toda la Av. América frente a la parada del Seminario Mayor, entre Farmacias Medicity y Radio Católica, en un edificio de tres pisos, color blanco,se encuentra un perro de características Bull Dog (blanco con café) ENCADENADO en un tanque grande de vapor. (al parecer hacen lavado en seco). En el mismo lugar reposa una olla y un plato azul para la comida del perro que casi siempre esta vacía. El perro está sucio, flaco y maltratado,no se puede parar, está totalmente a la interperie y cerca de él se desprenden gases o vapores de las máquinas que utiliza la lavandería. Este patio al parecer es un almacenamiento de chatarras y maquinarias. Todo esto puedo verlo desde la ventana de mi lugar de trabajo','2','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/78-FRANC\' target=\'_blank\'>Link denuncia</a>',1,0,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 16:39:05','84'),(239,31,11521,'2017-08-03 11:40:56',2,'MEMO-2017-343','JAIME MURIEL - ELOY ALFARO',NULL,NULL,NULL,'ESTADISTICAS JULIO','10','CUADRO ESTADISTICO',1,2,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 16:40:51','76'),(240,31,11522,'2017-08-03 11:43:24',2,'MEMO-2017-343','JAIME MURIEL - ELOY ALFARO',NULL,NULL,NULL,'ESTADISTICAS JULIO','4','CUADRO ESTADISTICO',1,2,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 16:43:56','81'),(241,31,11523,'2017-08-03 11:45:36',2,'MEMO-2017-341','JAIME MURIEL - ELOY ALFARO',NULL,NULL,NULL,'REGISTRO DIARIO','7','REGISTRO DE ASISTENCIA',1,3,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 16:45:34','83'),(242,31,11524,'2017-08-03 11:48:10',2,'MEMO-2017-344','JAIME MURIEL - ELOY ALFARO',NULL,NULL,NULL,'ESTADISTICAS JULIO','10','CUADRO ESTADISTICO',1,