3:18',2,'S/N','AB.ANITA LAMIÑA',NULL,NULL,NULL,'EXP.2017-0137-AMC-CMASA-ZEE','13','-',1,4,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 17:24:09','89'),(252,7,11534,'2017-08-03 12:27:01',2,'S/N','DR.ESTEBAN GOMEZ JURADO',NULL,NULL,NULL,'TRAMITE 3115','3','-1 CD',1,1,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 17:26:50','78'),(253,4,11535,'2017-07-31 09:58:00',1,'Denuncia web - 69','Patri Vera Nieto',NULL,'1710570589','patrivera.n@gmail.com',' <br />\r\nEl día sábado 29 de julio de 2017 a las 5h00 pm fui a la tienda el Comisariato de las Mascotas a comprar comida para mis perros, me percaté de que en la jaula de pajaritos (donde había varios) estaba uno en particular muy mal, decaído sin abrir sus ojos y respirando agitadamente. Cuando trataba caminar se volteaba y se caía para un costado como se puede ver en el video que adjunto. Le pregunté al vendedor de la tienda y me dijo que era estrés porque recién había llegado el día anterior y que ya lo iba a retirar de la jaula. <br />\r\nVolví a la tienda más o menos una hora más tarde y me di cuenta de que el pajarito seguía en la misma jaula y su condición se veía peor sin que haya sido retirado de la jaula ni revisado por el personal del local.<br />\r\nAdemás dicho local mantiene hasta 3 perritos en las vitrinas, así como gatos, conejos, y tortugas en peseras','2','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/69-Patri\' target=\'_blank\'>Link denuncia</a>',1,0,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 17:34:54','84'),(254,4,11536,'2017-07-31 18:13:00',1,'Denuncia web - 72','Paola Montes de Oca N',NULL,'1722690284','stefy24680@gmail.com','Buenas tardes, en esta dirección se encuentra una familia que desde hace varios años ha tenido diferentes perritos, los llevan a su casa cuando son cachorros, pero cuando comienzan a crecer empiezan a dejarlos afuera a la intemperie sin importarles nada, si el perrito se entra a la casa lo sacan a propósito y después de un tiempo los van a dejar botados en la calle (Hecho que ha sido confirmado por familiares cercanos a esta familia), el perrito que se encuentra en las fotografías adjuntadas al parecer es el quinto perrito que ellos llevan, ahora que esta más crecidito han empezado a dejarlo fuera, está flaquito sucio y solo pasa llorando; realmente es penoso ver como los abandonan al crecer y al ser un hecho que se ha venido repitiendo varios años espero que se los pueda sancionar, verificando con personas que vivan cerca a estas personas. En una de las fotografías se observa la entrada de la casa de estas personas.','2','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/72-Paola\' target=\'_blank\'>Link denuncia</a>',1,0,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 17:47:49','84'),(255,7,11537,'2017-08-03 12:50:38',2,'S/N','ENRIQUE ANDRADE VILLAMARIN',NULL,NULL,NULL,'QUEJA VIA TELEFONICA','12','-',1,1,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 17:50:43','77'),(256,7,11538,'2017-08-03 12:54:03',2,'S/N','DR.JAIME MOYANO',NULL,NULL,NULL,'EXP.388-2017-UDCMCL-ZEE','1','-',1,6,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 17:53:48','79'),(257,5,11539,'2017-08-03 13:02:13',2,'S/N','CONCEJAL METROPOLITANO-CARLOS PAEZ',NULL,'','','SOLICITA INFORME','12','-',1,0,'SIN GUIA','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 18:04:28','78'),(258,31,11540,'2017-08-03 13:08:07',2,'S/N','HECTOR RODRIGUEZ VILLAREAL',NULL,'','','REFERENTE A DENUNCIA DMT-AT-2016-4342','4','COPIAS VARIOS DOCUMENTOS',1,5,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 18:08:09','142'),(259,4,11541,'2017-07-31 22:05:00',1,'Denuncia web - 73','CARLO VELEZ INTRIAGO',NULL,'1306739473','carlangasvelezi@gmail.com','LAS PERSONAS YA FUERON DENUNCIADAS CON ANTERIORIDAD, PERO EL MOMENTO DE RECIBIR AL INSPECTOR LE CANCELARON UN DINERO Y PERMITIERON QUE SE CONTINÚE LA OBRA, AHORA TIENEN OBRAS A MEDIO ACABAR, OTRAS OBRAS QUE ESTÁN COMENZANDO Y PARA COLMO, DEBEN HACER LAS VEREDAS PUES NO PERMITIERON QUE SE LO HAGA, ESTA GENTE SE APROVECHÓ DE UNA QUEBRADA PARA CONSTRUIR Y NO LA RESPETARON Y NO ACATAN NINGUNA DISPOSICIÓN DE LAS AUTORIDADES, ASI ES COMO INCLUSO EN LAS NOCHES DEJAN UN VEHÍCULO EN LA CALLE PROTEGIDO POR DOS PIEDRAS ENORMES Y UN PALO, OBSTÁCULOS QUE HAN CAUSADO MAS DE UN ACCIDENTE Y NADIE HACE NADA PUES SON UN MONTON DE GENTE QUE SALE, INSULTA Y HACE PROBLEMA EN LA CALLE.<br />\r\nojala SE HAGA ALGO.','2','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/73-CARLO\' target=\'_blank\'>Link denuncia</a>',1,0,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 18:11:45','84'),(260,31,11542,'2017-08-03 13:21:41',2,'S/N','ESTEFANIA RAMIREZ',NULL,NULL,NULL,'REF. ACTA DE INSPECCION 514','4','COPIA LUAE',1,3,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 18:21:37','81'),(261,31,11543,'2017-08-03 13:25:23',2,'S/N','ESTEFANIA RAMIREZ',NULL,'','','REF. ACTA DE INSPECCION 516','4','COPIA LUAE',1,3,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 18:25:15','100'),(262,31,11544,'2017-08-03 13:27:56',2,'S/N','LEONARDO ALVAREZ',NULL,'','','REF. LUAE','1','COPIAS DE VARIOS DOCUMENTOS',1,13,'REFERENTE ACTA 003 DEL 29-07-2017','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 18:27:58','79'),(263,4,11545,'2017-08-01 11:05:00',1,'Denuncia web - 75','MAYRA MORENO MUÑOZ',NULL,'0502811664','mayrifer@hotmail.com','EL DIA MARTES 25 DE JULIO A LAS 8PM ESTABA HACIENDO EJERCICIO EN EL PARQUE DE LA CAROLINA, Y CUANDO PASABA JUSTO ATRAS DE LA TRIBUNA DE LOS SHYRIS SALIO DE ESOS CUARTOS QUE HA HABIDO AHI UN PERRO Y ME ATACÓ, ME MORDIÓ LAS DOS PIERNAS Y DE SUERTE NO ME MATÓ. ERA UN PERRO NEGRO CON BLANCO Y MEDIO PLOMO. <br />\r\nME TUVE QUE IR CORRIENDO Y ME FUI A EMERGENCIAS DEL IESS. PUSE LA DENUNCIA DESPUES EN EL CENTRO DE SALUD Y LUEGO ME LLAMARON INDICANDO QUE ESTE PERRO YA ES LA TERCERA VEZ QUE ATACA A LAS PERSONAS Y QUE NO TIENE DUEÑO, QUE EL PERRO VIVE AHI Y HAY UNA SEÑORA QUE LE DA DE COMER PERO NO ES LA DUEÑA Y NADIE SE HACE CARGO. ME INDICAN QUE EL MINISTERIO DE SALUD HA HABLADO VARIAS VECES CON EL MUNICIPIO PARA QUE SE LLEVEN A ESE PERRO Y OTROS MAS IGUAL DE PELIGROSOS QUE VIVEN AHI PERO NO SE LOS LLEVAN, Y MIENTRAS TANTO SIGUEN MORDIENDO A LA GENTE, IMAGINESE QUE AHI VAN NIÑOS Y UN MONTON DE GENTE, VAMOS A HACER DEPORTE Y NOS ENCONTRAMOS CON ESE PELIGRO, POR FAVOR URGENTE LLEVARSE A ESOS PERROS. ESPERO SU AYUDA URGENTE, GRACIAS!','2','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/75-MAYRA\' target=\'_blank\'>Link denuncia</a>',1,0,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 18:31:24','84'),(264,7,11546,'2017-08-03 13:32:29',2,'S/N','PATRICIO PARRA',NULL,NULL,NULL,'ALCANCE EXP. 535-2015','5','-',1,1,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 18:32:27','82'),(265,31,11547,'2017-08-03 13:33:38',2,'S/N','ANA CECILIA BURGOS',NULL,NULL,NULL,'DESESTIMACION DE DENUNCIA','3','COPIA DE DENUNCIA Y CEDULA',1,3,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 18:33:33','78'),(266,31,11548,'2017-08-03 13:37:20',2,'OFC-2017-034','DENNIS SUAREZ - SECRETARIA DE SEGURIDAD',NULL,NULL,NULL,'SOLICITA INFORMACION DE PERSONAL','12','-',1,1,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 18:37:20','77'),(267,5,11549,'2017-08-03 14:04:03',2,'S/N','JUAN BASANTES',NULL,NULL,NULL,'PIDEN AYUDA DE BIENES PERECIBLES','12','-',1,4,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 19:03:38','77'),(268,31,11550,'2017-08-03 14:16:52',2,'S/N','RUSSBY RODRIGUEZ REYES',NULL,'','','REF. EXP-2017-057','17','COPIA DE EXPED',1,3,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-03 19:17:12','96'),(269,5,11551,