djunta cédula catastral referencial del sitio de la infracción, la cédula catastral adjunta no corresponde al predio ni propietario que están realizando los trabajos antes señalados.','3','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/83-Ameli\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-07 13:23:04','114'),(393,4,11675,'2017-08-03 14:00:00',1,'Denuncia web - 82','Damiá Toro Calderón',NULL,'1704191889','damiantoro@gmail.com','En el sector de Miravalle 1 en el parterre central ubicado en los cruces de la Av Oswaldo Guayasamín y Eugenio Espejo se coloca una venta de comidas en los horarios de 18 a 20 horas. Colocan un generador de corriente que causa mucho ruido, además el humo de las comidas que preparan llegan a nuestros negocios y hogares, lo cual implica también una contaminación ambiental. El automovil en el que se moviliza esta venta ambulante es una camioneta de doble cabina color gris de placas TCR0995.','3','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/82-Damiá\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-07 13:24:07','109'),(394,4,11676,'2017-08-03 17:14:00',1,'Denuncia web - 84','Maria Muñoz Jaramillo',NULL,'1708748049','mauge.munoz@yahoo.com.com','El chifa Li Yuan se encuentra haciendo una construcción en la parte posterior del restaurante adosada a la clínica San Gabriel aumentando el el area de utilización del predio. Se presume por la estructura que quizás se haga también un segundo piso. Ademas las condiciones de higiene del restaurante afecta las condiciones de operación de la clínica por su insalubridad siendo un foco de infecciones y causas de roedores que ya se han pasado ala clínica.','3','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/84-Maria\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-07 13:26:37','109'),(395,4,11677,'2017-08-04 07:48:00',1,'Denuncia web - 86','KARIN GARCIA HERDOIZA',NULL,'1714284096','kari_garcia24@hotmail.com','7:48<br />\nBUENOS DIAS FELICITÁNDOLOS POR SU LABOR TAN LOABLE A FAVOR DE LOS ANIMALITOS EN SITUACION DE RIESGO ACUDO A USTEDES PARA QUE ATIENDAN UN CASO EN SAN MIGUEL DE CONOCOTO HAY TES PERRITOS EN SITUACION DE RIESGO LOS MISMOS QUE VIVEN CON UNA FAMILIA DE ESCASOS RECURSOS  EL DIA DE AYER AL MAS ANCIANITO LE ATROPELLO EL CARRO Y ESTA AFECTADO SU OJO NO HEMOS PODIDO TOMAR FOTOS LAMENTABLEMENTE YA QUE LO TIENEN GUARDADO PERO SABEMOS QUE NO HAY INTERES DE SUS DUEÑOS EN LLEVARLE A QUE LO ATIENDAN CONTAMOS CON SU GRAN APOYO PARA QUE ESTOS ANIMALITOS TENGAN UNA MEJOR VIDA','3','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/86-KARIN\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-07 13:30:37','109'),(396,4,11678,'2017-08-06 15:35:00',1,'Denuncia web - 93','Andre Cevallos Arauz',NULL,'1711399889','azuliverde7@hotmail.com','Quisieramos denunciar el maltrato que recibe esta mascosta. En los últimos días hemos estado pendientes de su estado, descubriendo que el can se encuentra todo el día y la noche en esta área de la casa (patio interno), sin recreación alguna, además expuesto a la contaminación producto de su cercanía a sus propias heces y orina. Igualmente, nos hemos percatado de su constante llanto y una complicación que tiene en su ojo izquierdo que no le permite ver bien. Por las noches, cuando se encuentran sus amos en la casa, la situación es la misma: el can no deja de llorar y no se le permite el acceso a la edificación. Por ahora no hemos evidenciado algún tipo de maltrato físico, solo estas precarias condiciones a las que se les somete día tras día. De esta manera, hacemos esta denuncia pensado en la posibilidad de mejorar las condiciones de vida de esta mascota, las cuales muy posiblemente no encuentre con sus actuales dueños.','3','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/93-Andre\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-07 13:48:21','109'),(397,31,11679,'2017-08-07 09:25:14',2,'MEMO-2017-348','LUIS CHULCA  - LA DELICIA',NULL,NULL,NULL,'INSISTENCIA DE INFORME TECNICO','3','-',1,1,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-07 14:24:59','109'),(398,31,11680,'2017-08-07 09:27:16',2,'MEM0-2017-351','LUIS CHULCA - LA DELICIA',NULL,NULL,NULL,'INSISTENCIA A INFORME TECNICO ','3','-',1,3,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-07 14:27:07','109'),(399,31,11681,'2017-08-07 09:33:36',2,'MEMO-2017-351','LUIS TUFIÑO - LA DELICIA',NULL,NULL,NULL,'INFORME DE EXPEDIENTE ','5','MEMO-2017-1050-AMC-DRYE',1,7,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-07 14:33:19','111'),(400,31,11682,'2017-08-07 09:50:00',1,'MEMO-2017-352','LUIS TUFIÑO - LA DELICIA ',NULL,NULL,NULL,'REMITE DENUNCIA POR ADOSAMIENTO','2','FORMULARIO, COPIA DE CEDUA Y FOTOS',1,7,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-07 14:50:02','116'),(401,5,11683,'2017-08-07 09:51:24',2,'S/N','EMMA ONOFRE',NULL,NULL,NULL,'SOLICITA INFORME URGENTE','12','-',1,3,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-07 14:51:01','112'),(402,31,11684,'2017-08-07 09:52:25',1,'MEMO-2017-352','JORGE DELGADO',NULL,'1700214275','jdelgado2338@hotmail.com','REMITE DENUNCIA POR PREDIO EN MAL ESTADO','3','FORMULARIO Y FOTOS',1,6,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-07 14:52:12','109'),(403,7,11685,'2017-08-07 09:54:07',2,'S/N','GEOVANNA VITERI',NULL,'1705877692','albertasantini@yahoo.com','ADOSAR SIN AUTORIZACION','3','-',1,12,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-07 14:54:11','109'),(404,31,11686,'201