017-08-10 16:33:06','150'),(790,31,12067,'2017-08-10 11:34:47',2,'OFC-624-GEF-DE','MARIA LORENA BELTRAN - EPMMOP',NULL,NULL,NULL,'SOLICITUD DE CONTROL VIA A NAYON','12','GDOC-2017-115312',1,1,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-10 16:34:55','147'),(791,7,12068,'2017-08-10 11:35:37',2,'OFC.0001141','MSC.SANTIAGO CACERES',NULL,NULL,NULL,'CENTROS DE TOLERANCIA NIGHT CLUBS','12','-',1,3,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-10 16:36:08','147'),(792,4,12069,'2017-08-07 17:52:00',1,'Denuncia web - 98','Maril Monteros Tamayo',NULL,'1726172701','marilynmon2007@hotmail.com','Es el caso de una perrita mestiza grande que habita en esa casa, la pobre esta súper desnutrida tanto así que ya se puede observar sus costillas y huesos, las personas que viven ahí no le dan la atención que requiere , no la alimentan, ni le dan agua; en ocasiones que me he acercado a darle un pan, pude escuchar que su respiración es ronca me supongo que está enferma y como no tienen defensas en su cuerpo es peor, hay días que ya no tiene ánimos ni para caminar, pude observar que en esa casa habitan otros dos perros que están en las mismas condiciones súper flaquitos, converse con unos vecinos y me pudieron informar que  habían visto en una ocasión que el dueño les había pegado con una vara.<br />\nPor favor es muy necesaria su ayuda esos pobres animalitos lloran por las noches ya no pueden seguir viviendo en esas condiciones, deben retirarles los perritos a esas personas, no los pueden cuidar con deben, y esa perrita un día puede hasta morir de la desnutrición que tiene les pido vengan a revisar el caso lo más pronto posible. <br />\n<br />\nObservaciones: En la casa pasa casi todo el día una señora, y algunas personas llegan por la tarde después de sus labores.<br />\nAdjunto se encuentran fotos de la perrita grande y también una de la pequeña que también vive ahí.<br />\n','3','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/98-Maril\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-10 16:41:28','146'),(793,31,12070,'2017-08-10 11:39:49',1,'DENUNCIA','JORGE VINUEZA MANTILLA',NULL,'171090526-4','jwvinueza@hotmail.com','CONTROL LUAE Y CONTAMINACION AUDIVA','3','COPIA CEDULA + 1 CD',1,4,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-10 16:42:57','146'),(794,4,12071,'2017-08-08 11:11:00',1,'Denuncia web - 100','DIANA HERNÁNDEZ OLIVO',NULL,'1715052781','chabely_h@hotmail.com','Se ha generado un parqueadero con la instalación de puertas movibles que invaden el libre paso de peatones en el pasaje además que se usa frecuentemente el pasaje como parqueadero cuando estos pasajes son de uso peatonal . Obstaculizan el libre paso de peatones y torna peligroso el pasaje tanto en la mañana como en l noche porque impide la libre vista de todo el pasaje ','3','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/100-DIANA\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-10 16:48:45','146'),(795,31,12072,'2017-08-10 11:50:55',2,'S/N','NANCY SILVA CARVALAL',NULL,NULL,NULL,'REFERENTE AL EXPEDIENTE 2017-125','13','FOTOGRAFIAS',1,3,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-10 16:50:42','152'),(796,31,12073,'2017-08-10 11:53:02',2,'S/N','NELLY PEREZ DE ROMO - ICOM',NULL,NULL,NULL,'REFERENTE AL EXPEDIENTE 223-2017','1','FOTOGRAFIAS',1,2,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-10 16:52:53','148'),(797,5,12074,'2017-08-10 11:53:30',2,'S/N','MAGALI VALDIVIESO',NULL,NULL,NULL,'CONOCIMIENTO DE PAGO DE MULTA','16','-',1,3,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-10 16:53:35','154'),(798,31,12075,'2017-08-10 11:57:59',2,'OFC-2017-0458-CRAC-DNA','RICHARD RIERA - ADIESTRAMIENTO CANINO',NULL,NULL,NULL,'REFERENTE A OFICIO 723-AMC-DMI-FU-2017','3','PRUEBAS DE TEMPERAMENTO',1,16,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-10 16:58:34','146'),(799,4,12076,'2017-08-09 11:40:00',1,'Denuncia web - 104','Sandr Chiliquinga Bon',NULL,'1802541530','sandroch3@yahoo.com','Saludándoles cordialmente informo el mal comportamiento de la Señora Loenor arrendataria del inmueble de la manzana 21 casa 17 número de predio Oe12-276, la misma que sin motivo alguno abre el portón de la vivienda que arrienda obstaculizando el parqueo y circulación de los vehículos del pasaje 4,este pasaje es muy estrecho,<br />\nAdemás para hacer mayor daño saca desperdicios escombros a la calle mencionada, ocasionando raya duras a mi vehículo.<br />\nLos vecinos y la directiva del sector se acercaron a hablar con la señora, pero no entiende razones.<br />\nLa señora ha amenazado con poner clavos en los neumaticos y seguir rayando mi vehículo, que tiene asignado un lugar de parqueo en un costado de su portón, sin obstaculizar el ingreso a la vivienda.<br />\nAdemás tengo miedo que arremeta contra mi casa, rompa los vidrios o algo así, pues la Sra. es muy impulsiva y violenta.<br />\nComo la señora tiene una hija con discapacidad dice que no le pueden hacer nada, ya que tiene el carnet del CONADIS. <br />\nSolicitándoles comedidamente que por su intermedio se de solución a este inconveniente y que se le indique que no puede obstaculizar las calles por simple capricho.','3','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/104-Sandr\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-10 16:58:58','146'),(800,4,12077,'2017-08-09 20:05:00',1,'Denuncia web - 103','DAMIA TORO CALDERON',NULL,'1704191889','damiantoro@gmail.com','Por segunda vez me veo obligado a presentar esta denunci pues hice una anteriormente el día 3 de agosto con el código de trámite número 11675. <br />\nEn el sector de Miravalle 1/San Isidro en el parterre central ubicado en los cruces de la Av Oswaldo Guayasamín y Eugenio Espejo se coloca una venta de comidas en los horarios de 18 a 2:30 horas. Colocan un generador de corriente que causa mucho ruido, además el humo de las comidas que preparan llegan a nuestros negocios y hogares, lo cual implica también una contaminación ambiental. El automovil en el que se moviliza esta venta ambulante es una camioneta de doble cabina color gris de placas TCR0995.<br />\nEl día de hoy 9 de agosto pude ver la presencia de una camioneta del Municipio de Quito sin embargo la venta ambulante continúa en el sector.','3','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/103-DAMIA\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-10 17:03:10','146'),(801,31,12078,'2017-08-10 12:07:38',2,'S/N','SEGUNDO HERNAN GUAMAN',NULL,NULL,NULL,'REFERENTE A RESOLUCION 2017-667','5','COPIA DE PAGO Y CONVENIO DE PAGO',1,3,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-10 17:08:17','150'),(802,4,12079,'2017-08-09 23:54:00',1,'Denuncia web - 105','Carlo Viteri Mañdpmad',NULL,'1725903270','c4rlosviteri@gmail.com','Las personas que viven dentro del parque (\"cuidan\") tienen 3 perritos en malas condiciones, especialmente un viejito negro que tiene sarna, tumores y tanta secreción lagrimal que ha ido perdiendo la vista. Sobrevive de lo que le da la gente, no lo alimentan, ni lo bañan ni lo llevan al veteriario a pesar de los múltimples problemas de salud que tiene.','3','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/105-Carlo\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-10 17:09:13','146'),(803,5,12080,'2017-08-10 12:09:45',2,'OFC 11743-2017-DOAMT','AB. JORGE AMIREZ-AGENCIA METROPOLITANA DE TRANSITO',NULL,NULL,NULL,'SOLICITUD DE OPERATIVOS DE CONTROL','3','-',1,0,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-10 17:09:55','146'),(804,4,12081,'2017-08-07 19:28:00',1,'Denuncia web - 99','MANUE NARVAEZ PEREZ',NULL,'1703869170','manuelnarvaezperez@hotmail.co','La Administración del Condominio Ladera Este a nombre de todos los copropietarios del edificio, tengo a bien dirigirme a vuestra autoridad para realizar la denuncia formal por cuanto la arrendataria del Departamento de PB de dicho edificio, Sra. Monica Bustamante, sin autorización alguna de los propietarios, peor aun de la administración Municipal, a cedido el espacio del garaje de dicho departamento el cual queda a nivel de la Av. Gonzlaez Suarez, para que en dicho sitio se instale un negocio de venta de verduras, como hago contar en las fotos que acompaño a la presente denuncia.<br />\n<br />\nA pesar de haberle solicitado de la manera mas comedida y educada que desistiera de tal actividad, ya qeu ese sitio no fue creado para tal efecto, contravinienod de manera flagrante la Ley de Propiedad Horizontal y haciendo caso omiso a nuestra solicitud.<br />\n<br />\nMi pedio concreto a nombre de los señores copropietarios del edificio, es una intervención directa del departamento respectivo del Ilustre Municipio de Quito, parque se proceda con la clausura de dicho local y la sanción respectiva, con el fin de que no se vuelva a reabrir dicho espacio, que atenta al ornato y buena presentación del edificio.<br />\n<br />\nEste negocio es ilegal desde todo punto de vista, generalmente esta abierto los días martes, en un horario comprendido desde las 09:00 hasta las 12:00<br />\n<br />\nPor la favor que se preste a la presente, anticipo mis mas sinceros agradecimientos.<br />\n<br />\nAtentamente.<br />\n<br />\nManuel Enrique Narvaez Perez<br />\nAdiministrador<br />\nmanuelnarvaezperez@hotmail.com<br />\n','3','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/99-MANUE\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NU