17-08-14 15:43:00',2,'S/N','PATRICIA LEXANDRA MARTINEZ','',NULL,NULL,'REFRENTE AL EXPEDIENTE 385-2017','1','COPIA LUAE',1,6,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-14 20:43:22','159'),(956,31,12233,'2017-08-14 16:03:30',2,'S/N','MARYURY LOOR ZAMBRANO','',NULL,NULL,'REFRENTE AL EXPEDIENTE 051-2017','5','COPIA DE PAGO',1,3,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-14 21:03:49','169'),(957,31,12234,'2017-08-14 16:23:02',2,'S/N','VALERIA CAMPOS VELIZ','',NULL,NULL,'REFRENTE AL EXPEDIENTE 189-2017','1','-',1,2,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-14 21:23:17','170'),(958,4,12235,'2017-08-14 12:30:00',1,'Denuncia web - 115','José  Guerra',NULL,'1702529932','jguerra@audicomex.com','Estimados Señores\nMunicipio de Quito\nPresente\n\nHoy día 14 de agosto del 2017, mediante la página web del Municipio de Quito quiero expresar mi denuncia acerca de una invasión por personas desconocidas, que están construyendo arbitrariamente al filo de la quebrada, ubicado en la calle empedrada Rafael Carvajal, en el sector de Carcelén a continuación del Complejo del Deportivo Quito.\n\nQuisiera expresar mi absoluta preocupación por este hecho arbitrario, que atenta al medio ambiente y a la seguridad del Barrio, toda vez que esta calle va a servir en el futuro, para solucionar el tráfico con el nuevo proyecto  de vivienda que tiene en mente el Gobierno Nacional en los Terrenos de propiedad del Banco de la Vivienda, cuya calle debe ser ampliada para facilitar el gran  tráfico que habrá en el futuro.\n\nMuchas gracias por su atención y esperando su pronta respuesta.\n\nAtentamente,\n\n\nEco. José María Guerra\nCUIDADANO\nC.C: 170252993-2','3','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/115-José \' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-14 22:37:36','168'),(959,4,12236,'2017-08-14 13:52:00',1,'Denuncia web - 116','Paola González Quilum',NULL,'1725029936','paolago9709@gmail.com','Mi vecino maltrata todos los días a su perro, le da con palos,  he ido a timbrarle a su casa he hablado con él y le he dicho que no le pegue, pero no le interesa, todos los dias y las noches  es lo mismo,  por último hace dos días le pegaba  al perro como salvaje y el hijo le dijo que ya le saque que no quería verle al perro en la casa que le abandone, le dejaron unas horas  afuera luego lo metieron a la casa pero le tienen amarrado y el perro llora todo el día, no puede escaparse de lis golpes poeque está  encadenado,  yo tengo algunos perros inclusive rescate uno de el mismo señor porque el dijo que lo iba a matar, ya no puedo adoptar mas porque la casa no es mía, pido que se puedan aplicar todas las leyes  con sus respectivas sanciones, y que le prohíban tener, por último la dueña del perro no le defiende y dice que tiene que ser sometido porque solo así  aprendieron los perros anteriores,  noes la  primera vez que abusan de esos animales, y antes ya les había denunciado, pero nunca  se concretó nada. Hablo en nombre de los seres que no tienen voz , que no pueden defenderse. La casa es blanca, un  solo piso puerta de madera y la nomenclatura  es E7-132. No puedo colocar imagen porque tengo que subir al muro y no es posible, mil disculpas por subir fotos de mi cédula.','3','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/116-Paola\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-14 22:39:44','168'),(960,4,12237,'2017-08-14 12:30:00',1,'Denuncia web - 114','José  Guerra',NULL,'1702529932','jguerra@audicomex.com','Estimados Señores\nMunicipio de Quito\nPresente\nHoy día 14 de agosto del 2017, mediante la página web del Municipio de Quito quiero expresar mi denuncia acerca de una invasión por personas desconocidas, que están construyendo arbitrariamente al filo de la quebrada, ubicado en la calle empedrada Rafael Carvajal, en el sector de Carcelén a continuación del Complejo del Deportivo Quito\nQuisiera expresar mi absoluta preocupación por este hecho arbitrario, que atenta al medio ambiente y a la seguridad del Barrio, toda vez que esta calle va a servir en el futuro, para solucionar el tráfico con el nuevo proyecto  de vivienda que tiene en mente el Gobierno Nacional en los Terrenos de propiedad del Banco de la Vivienda, cuya calle debe ser ampliada para facilitar el gran  tráfico que habrá en el futuro \nMuchas gracias por su atención y esperando su pronta respuesta. \n \nAtentamente, \n \nEco. José María Guerra \nCUIDADANO \nC.C: 170252993-2 \n','15','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/114-José \' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-14 22:40:14',''),(961,4,12238,'2017-08-10 12:53:00',1,'Denuncia web - 109','Jaime Félix Rodríguez',NULL,'1717063075','emanuelfelixr@yahoo.com','Reciban un cordial saludo,\nEl día de ayer 9 de agosto de 2017, el vecino Sr. Jaime Torres envió a uno de sus empleados a colocar carne de gallina con veneno en el sector del Lllano. Esto produjo que 5 perros del barrio de diferentes vecinos fueran envenenados muriendo uno de ellos de la forma más cruel posible. Los otros cuatro perros fueron salvados gracias al suministro del medicamento Atropina que se consiguió en la parroquia de Guayllabamba, lamentablemente hasta traer los medicamentos la perrita más pequeña no soporto el veneno y murió.\nAl realizar una inspección con todos los vecinos afectados se pudo encontrar en los lindes del terreno una cantidad ingente de gallinas rostizadas con veneno, debido al peligro que esto representaba se procedió a recoger toda la carne envenenada y ha incinerarla para evitar que más perros del barrio lleguen a ser envenenados. \nEsta practica del Sr. Torres y de sus empleados, de envenenar perros, a sido sistemática a lo largo de los últimos 20 años pero debido a la falta de una ley en aquellos años siempre se ha quedado sin sanción. Es por esta razón que solicito a las autoridades competentes se sancione al Sr. Torres y sus empleados de acuerdo a la ordenanza 0048 como una infracción muy grave de atentar contra la vida de animales y matar cruelmente a uno de ellos. \nPor otra parte vivimos en una zona residencial y el Sr. Torres mantiene los galpones de aves de corral a tan solo 20 metros de las viviendas, se ha realizado denuncias al Ministerio del Ambiente para que retiren los galpones de gallinas de la zona residencial pero ha hecho caso omiso a las autoridades. Estos galpones no solo trae peligros contra la salud de los residentes del barrio sino también contra los animales, pues entre sus prácticas están acostumbrados a botar gallinas muertas y enfermas a los linderos, bruto de ellos hace menos de un mes varios perros fueron contagiados con una enfermedad que en el PAE lo diagnosticaron como Tos de Perrera y para el cual tuvieron que recibir tratamiento todos los animales. \nDe antemano quiero agradecer a las autoridades su colaboración y se tome medidas para este caso, pues en una sociedad es necesario vivir en armonía, respeto y tolerancia con los vecinos y sus animales. \nAtt. \nIng. Jaime Emanuel Félix R \nPuéllaro - Ecuador \n','3','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/109-Jaime\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-14 22:51:22','168'),(962,4,12239,'2017-08-10 13:41:00',1,'Denuncia web - 107','Gabri Guerrero',NULL,'1716999063','gabyguerrero23@hotmail.com','En la casa de al lado hay 2 perros (Husky y Schnauzer) les tienen todo el dia en el patio, la casa que tienen es muy pequeña y está rota. El patio donde las mascota pasan está lleno de excremento y de orina, no tienen comda ni agua en sus platos. Los perros estan sucios y desnutridos. Espero que nos puedan ayudar lo mas pronto posible.','3','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/107-Gabri\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-14 22:57:09','168'),(963,5,12240,'2017-08-15 08:45:02',2,'ofc azee-373-2017','ECO. LORENA BASSANTE','ZONA NORTE',NULL,NULL,'DEVOLUCION DE EXPEDIENTE','5','-',1,8,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-15 13:45:55','169'),(964,31,12241,'2017-08-15 09:22:47',2,'S/N','HE DAOHUIN','',NULL,NULL,'REFRENTE A RESOLUCION 2017-890','5','COPIA DE PAGO',1,3,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-15 14:23:07','169'),(965,31,12242,'2017-08-15 09:25:19',2,'OFC-2017-2184','GABRIEL BAZURTO - BOMBEROS','CUERPO DE BOMBEROS',NULL,NULL,'INFORME DE INSPECCION ','1','INFORME',1,1,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-15 14:29:19','170'),(966,5,12243,'2017-08-15 09:29:42',2,'OFC 2178-2017','ING. GABRIEL BAZURTO','INSPECTORES BOMBEROS',NULL,NULL,'INSPECCION MI CAFETERIA','1','-',1,2,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-15 14:31:38','170'),(967,31,12244,'2017-08-15 09:31:41',2,'OFC-2017-2175','GABRIEL BAZURTO','CUERPO DE BOMBEROS',NULL,NULL,'INFORME DE INSPECCION','1','INFORME ',1,4,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-15 14:32:03','170'),(968,31,12245,'2017-08-15 09:33:16',2,'OFC-2017-2113','GABRIEL BAZURTO','CUERPO DE BOMBEROS',NULL,NULL,'INFORME DE INSPECCION','1','INFORME',1,2,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-15 14:33:39','170'),(969,5,12246,'2017-08-15 09:33:04',2,'OFC 2017-2180','ING. GABRIEL BAZURTO','INSPECTORES BOMBEROS',NULL,NULL,'INSPECCION EL FLORIDITA CUBANO','1','-',1,2,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-15 14:33:41','170'),(970,31,12247,'2017-08-15 09:50:46',2,'S/N','GEORGINA CABASCANGO SORIA','',NULL,NULL,'