get=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-23 20:44:27','247'),(1629,31,12906,'2017-08-23 15:43:47',2,'OFC-2017-3155','PATRICIA SIZA','ADM ZONAL LA DELICIA',NULL,NULL,'CONTROL LUAE A FABRICA DE BLOQUES','12','GDOC-2017-119011',1,5,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-23 20:44:43','242'),(1630,31,12907,'2017-08-23 15:45:32',2,'OFC-2017-3168','PATRICIA SIZA','ADM ZONAL LA DELICIA',NULL,NULL,'CONTROL LUAE A FABRICA DE BLOQUES','12','GDOC-2017-119021',1,5,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-23 20:46:31','242'),(1631,31,12908,'2017-08-23 15:47:12',2,'OFC-2017-3152','PATRICIA SIZA','ADM ZONAL LA DELICIA',NULL,NULL,'INFORME TECNICO','12','GDOC-2017-114910',1,11,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-23 20:48:19','242'),(1632,4,12909,'2017-08-23 11:16:00',1,'Denuncia web - 140','Richa Morales Rubio',NULL,'1724804396','rsmorales93@gmail.com','En el conjunto residen 7 casas, las cuales cuentan con 3 pisos, en el pasado, cuando se ha intentado construir un piso más en las casas, determinado que las viviendas no son hábiles para soportar un piso más, actualmente las casas #3 y #4 se encuentran construyendo un cuarto piso de sus viviendas, sin dar a conocer a los propietarios de las otras casas, los cuales en caso de que los cimientos de dichas casas caigan, seríamos afectados seriamente, pues son casas contiguas que comparten una pared.<br />\nAdemás, existe violación a la privacidad, pues tengo fotos de gente que está en el techo de mi casa, caminando permanentemente.','3','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/140-Richa\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-23 20:49:33','247'),(1633,31,12910,'2017-08-23 15:51:03',2,'S/N','MARTHA SOFIA HERNANDEZ','',NULL,NULL,'REFERENTE AL EXPEDIENTE 346-2017','1','-',1,6,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-23 20:51:41','241'),(1634,31,12911,'2017-08-23 15:52:46',2,'OFC-2017-3135','PATRICIA SIZA','ADM ZONAL LA DELICIA',NULL,NULL,'REFERENTE AL OFICIO AMC-DRYE-DP-2017-261','5','-',1,6,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-23 20:53:42','248'),(1635,31,12912,'2017-08-23 15:54:30',2,'OFC-2017-3162','PATRICIA SIZA','ADM ZONAL LA DELICIA',NULL,NULL,'EXPEDIENTE PARA ICUS','2','-',1,3,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-23 20:55:11','243'),(1636,4,12913,'2017-08-22 17:45:00',1,'Denuncia web - 139','Karin Tipàn Rojas',NULL,'1722591623','karina.ptr_1193@hotmail.com','El motivo de la denuncia se debe a que la persona posee cuatro mascotas las mismas que se mentienen siempre dentro de la casa pero al momento de sacar y guardar sus vehiculos los dueños de la casa no tienen el mas minimo cuidado para mantenerlas dentro por lo cual las mascotas salen disparadas a la calle corriendo un riesgo para todos los moradores del sector. Han habido varios casos de mordeduras por parte de estas mascotas sin embargo es la primera vez que va a existir una denuncia para estas personas.<br />\nEl dia martes 22 de Agosto del 2017 a las 7:00 pm me encontraba con mi prima yendo a la tienda mientras pasabamos por dicho lugar las mascotas se encontraban fuera de su domicilio fue demasiado tarde el darme cuenta que los canes estaban cerca, fue cuando uno de ellos ( labrador negro) ataco a mi prima en el brazo provocandole una herida profunda en el antebrazo izquierdo, seguido de esto me regrese a mi casa para comunicarles a mis familiares lo sucedido, acto seguido fuimos a la casa de la señora y nos llevo a la clinica donde ella trabaja (clinica axis). En la clinica mi prima fue asistida, se le realizaron aproximadamente 15 puntos (internos y externos) Al siguiente dia mis padres hablaron con el propietario del perro y el se comprometio en cubrir todos los daños ocasionados por el perro al cabo de unos dias la situacion cambio debido a que al presentarle las facturas de los gastos medicos generados el dueño no quiso reconocernos  y por ese motivo estoy realizando la denuncia.<br />\nDos motivos que me llevaron a realizar la denuncia son: el primero por la parte moral debido a que no desearia que nadie mas pasara por lo que estamos pasando o que lleve a una situacion mas extrema. No es la primera vez que esto sucede en el barrio y si los moradores no han querido denunciar es porque estas personas se caracterizan por ser prepotentes y por creerse las victimas de la situacion, el segundo motivo es que deseo que exista algun tipo de sancion para los dueños o para el perro y tambien que se me reconozca todos los gastos generados hasta el momento.','3','Denuncia Web, <a href=\'http://agenciadecontrol.quito.gob.ec/index.php/denuncias/denuncias-amc/139-Karin\' target=\'_blank\'>Link denuncia</a>',1,0,'','true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-23 20:55:53','247'),(1637,31,12914,'2017-08-23 15:56:15',2,'OFC-2017-3163','PATRICIA SIZA','ADM ZONAL LA DELICIA',NULL,NULL,'EXPEDIENTE PARA ICUS','2','GDOC-2017-118416',1,3,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-23 20:56:55','243'),(1638,31,12915,'2017-08-23 15:57:36',2,'S/N','PATRICIA SIZA','ADM ZONAL LA DELICIA',NULL,NULL,'EXPEDIENTE PARA ICUS','2','GDOC-2017-118422',1,3,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-23 20:58:17','243'),(1639,31,12916,'2017-08-23 15:59:05',2,'OFC-2017-3157','PATRICIA SIZA','ADM ZONAL LA DELICIA',NULL,NULL,'CONTROL LUAE FABRICA DE BLOQUES','12','GDOC-2017-118895',1,6,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-23 21:00:05','242'),(1640,31,12917,'2017-08-23 16:00:47',2,'OFC-2017-3456','PATRICIA SIZA','ADM ZONAL LA DELICIA',NULL,NULL,'CONTROL LUAE A FABRICA DE BLOQUES','12','GDOC-2017-118979',1,5,NULL,'true',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2017-08-23 21:01:38','242'),(1641,31,12918,'2